function Album({ album }) {
  return (
    <div>
      <img arc={album.src} alt={album.title} />
      <h3>{album.title}</h3>
      <h2>{album.artist}</h2>
      <h1>{album.genre}</h1>
    </div>
  );
}
export default Album;
